import React from 'react';
import NowPlaying from './pages/NowPlaying/NowPlaying.js'
import Popular from './pages/Popular/Popular.js'
import TopRated from './pages/TopRated/TopRated.js'
import Search from './pages/Search/Search.js'
import './App.css';
import {
  Route,
  NavLink,
  HashRouter
} from "react-router-dom";

function App() {
  return (
    <div className="App">

      <header className="App-header">
      <div id="circle">
        <h1 id="main-heading">The <br></br>Ultimate <br></br>Moviegoers <br></br>Guide</h1>
        </div> 
      </header>
<HashRouter>
  <NowPlaying/>
  <Popular/>
  <TopRated/>
  <Search/>

<table>
  <tr>
    <th><NavLink to="/">Home</NavLink></th>
  </tr>
</table>

</HashRouter>

    </div>
  );
}

export default App;
